import React from "react";
import {Button, Drawer, DrawerCloseButton, DrawerContent, DrawerOverlay, useDisclosure} from "@chakra-ui/react";

function CountryLeagues(){
    const { isOpen, onOpen, onClose } = useDisclosure();
    const btnRef = React.useRef()

    return(
        <>
        <Button bg='transparent'  color='#7b7b7b' mt='50px' onClick={onOpen} ref={btnRef}> Country or League </Button>
        <Drawer
            isOpen={isOpen}
            placement='right'
            onClose={onClose}
            finalFocusRef={btnRef}
        >
            <DrawerOverlay/>
            <DrawerContent>
                <DrawerCloseButton/>
            </DrawerContent>

        </Drawer>
        </>
    )
}

export default CountryLeagues
